import Link from "next/link";

interface IProps {
  clients: any;
  reverse: boolean;
  sort: string;
}

const ClientsList = ({ clients, reverse, sort }: IProps) => {
  reverse
    ? clients.sort((a: any, b: any) => (b[sort] > a[sort] ? 1 : -1))
    : clients.sort((a: any, b: any) => (b[sort] > a[sort] ? -1 : 1));

  const tableClients = clients.map((e: any) => {
    const tableItem = () => {
      let items = [];
      for (let key in e) {
        items.push(<td key={e.key}>{e[key]}</td>);
      }
      return items;
    };

    return (
      <tr key={e._id}>
        {tableItem()}
        <td key={e._id}>
          <Link href="/clients/[id]" as={`/clients/${e._id}`}>
            <a>Go to client</a>
          </Link>
        </td>
      </tr>
    );
  });
  return tableClients;
};

export default ClientsList;
